import math

def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def composite_nums_between_indices(nums):
    composite_nums = set()
    for i in range(21, 98):
        if not is_prime(nums[i]):
            composite_nums.add(nums[i])
    return composite_nums
